import React from 'react'

const Wrap = (props: any) => (
  <div className="wrap">
    {props.children}
    {props.text}
  </div>
)

const App: React.FC<any> = () => {
  return (
    <Wrap>
      <div>Hello, world!</div>
    </Wrap>
  )
}

export default App
